import s from './Friends.module.css'

const Friend = (props) => {
    <div className={s.item + ' ' + s.active}>{props.name}</div>
}
const Friends = () => {
    return (
        <div className={s.items}>
            <Friend name={'Arman'} id={'1'}/>
            <Friend name={'Nurik'} id={'2'}/>
            <Friend name={'Madya'} id={'3'}/>
            <Friend name={'Damik'} id={'4'}/>
            <Friend name={'Sam'} id={'5'}/>
        </div>
    );
};

export default Friends;
